@piratexpirate
I notice that your 9(!) uploads have a minimum 4+GB size, the largest being over 39 GB. Not all of us have blazing fast ISP's and/or unlimited HD space. Yet we still love movies. Go figure. If you don't like 'slumming', why don't you stay uncontaminated up in your gigabyte palace, and just let us be happy with StyLishSaLH rips and the like, which are fine to those of us not putting them on a 102 inch HD plasma. Don't let the door hit you in the ass on your way out, thank you for shopping.
Stylish, Thanks, pal! Always good.
